,6,NULL,'item_07041.jpg',NULL,2000,NULL,3,1,NULL,NULL,'2018-12-28 17:12:34'),(7042,'The Beaches of Agnes',NULL,6,NULL,'item_07042.jpg',NULL,2008,NULL,3,1,NULL,NULL,'2018-12-28 17:16:42'),(7043,'One Sings, the Other Doesn\'t',NULL,6,NULL,'item_07043.jpg',NULL,1977,NULL,3,1,NULL,NULL,'2018-12-28 17:20:05'),(7044,'Jacquot de Nantes',NULL,6,NULL,'item_07044.jpg',NULL,1991,NULL,3,1,NULL,NULL,'2018-12-28 17:23:16'),(7045,'Το ταξίδι','Il Viaggio',8,1,'item_07045.jpg','<p><span style=\"font-family: Arial, Georgia, Tahoma, sans-serif; font-size: 12px; text-align: justify;\">Η Αντριάνα Μπράτζι, μια τριανταπεντάχρονη χήρα, ζει απομονωμένη επί δεκατρία ολόκληρα χρόνια στο σπίτι του νεκρού συζύγου της, στην καρδιά μιας κωμόπολης της Σικελίας. Η ξαφνική αρρώστια οδηγεί την Αντριάνα και τον κουνιάδο της, Τσέσαρε, στο Παλέρμο κι απο κεί στη Βενετία σ ένα ταξίδι έρωτα χωρίς επιστροφή. Αντλώντας τα στοιχεία της νουβέλας του, </span><span style=\"font-family: Arial, Georgia, Tahoma, sans-serif; font-size: 12px; text-align: justify;\">O Luigi Pirandello σκιαγραφεί την πιο αυστηρή εικόνα της θέσης της νησιώτισσας γυναίκας που συναντούμε σ ολόκληρο το έργο του.</span></p>',2012,NULL,NULL,NULL,NULL,73,'2019-01-03 17:55:48'),(7046,'Through a Different Lens: Stanley Kubrick Photographs',NULL,8,2,'item_07046.jpeg',NULL,2018,5,NULL,NULL,NULL,328,'2019-01-03 18:00:37');
